import React, { useState } from 'react';
import Combo from './components/combo';

export default function App() {
    const [selectedType, setSelectedType] = useState([]);
    const [types, setTypes] = useState([]);

    return (
        <div>
            <Combo list={types}></Combo>
        </div>
    );
}
